import React from "react";
import { Heading } from "../components/Heading";
import { AppInput } from "../components/UI/AppInput";
import { AppCheckbox } from "../components/UI/AppCheckbox";
import { Button } from "../components/Button";
import { Controller, useForm } from "react-hook-form";

export const AcceptPage = () => {
  const { constrol, handleSubmit } = useForm({
    defaultValues: {
      username: "",
    },
  });

  const onAcceptSubmit = (data) => {
    console.log(data);
  };
  return (
    <div className="container">
      <div className="wrapper">
        <div className="AcceptPage">
            <Controller/ >
          <Heading
            headingType="h1"
            text="АКЦЕПТ на предложение о заключении договора"
          />
          <form onSubmit={handleSubmit(onAcceptSubmit)}>
            <AppInput inputLabel="Ф.И.:" placeholder="Ваш ответ" type="text" />
            <AppInput
              inputLabel="Номер телефона"
              placeholder="+998 9- --- -- --"
              type="tel"
            />
            <AppCheckbox checkboxLebl="Ознакомился с публичной офертой" />
            <AppCheckbox checkboxLebl="Согласен с условиями публичной оферты" />
            <Button buttonType="submit" />
          </form>
        </div>
      </div>
    </div>
  );
};
